items:
- uid: SuperOffice.CRM.ArchiveLists.IArchiveProvider
  commentId: T:SuperOffice.CRM.ArchiveLists.IArchiveProvider
  id: IArchiveProvider
  parent: SuperOffice.CRM.ArchiveLists
  children: []
  langs:
  - csharp
  - vb
  name: IArchiveProvider
  nameWithType: IArchiveProvider
  fullName: SuperOffice.CRM.ArchiveLists.IArchiveProvider
  type: Interface
  assemblies:
  - SoDataBase.BusinessLogic
  namespace: SuperOffice.CRM.ArchiveLists
  summary: >-
    This is the external standard interface of archive providers exposed to the service layer and the world in general.

    The <xref href="SuperOffice.CRM.ArchiveLists.ArchiveProviderFactory" data-throw-if-not-resolved="false"></xref> creates and returns providers by this type.
  remarks: >-
    It is an interface that aggregates the extensible and provider properties of archive provider classes. It

    is an intermediate stage between the pure property interfaces (<xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderExtensible" data-throw-if-not-resolved="false"></xref>, 

    <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderDoesExtend" data-throw-if-not-resolved="false"></xref>, <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderHasColumns" data-throw-if-not-resolved="false"></xref>, <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderHasRows" data-throw-if-not-resolved="false"></xref>

    and <xref href="SuperOffice.CRM.ArchiveLists.IArchiveProviderHasEntities" data-throw-if-not-resolved="false"></xref>) and the actual provider class interfaces that have queries:

    <xref href="SuperOffice.CRM.ArchiveLists.IArchiveQueryProvider" data-throw-if-not-resolved="false"></xref> and <xref href="SuperOffice.CRM.ArchiveLists.IArchiveMultiQueryProvider" data-throw-if-not-resolved="false"></xref>. 

    <p></p>

    It also adds in the <xref href="SuperOffice.Factory.IPlugin" data-throw-if-not-resolved="false"></xref>

    interface, to ensure that all classes implementing this interface also qualify as plugins (though they also need to

    be tagged with the <xref href="SuperOffice.CRM.ArchiveLists.ArchiveProviderAttribute" data-throw-if-not-resolved="false"></xref> to be discovered by the factory)..
  example: []
  syntax:
    content: 'public interface IArchiveProvider : IArchiveProviderHasRows, IArchiveProviderHasColumns, IArchiveProviderHasEntities'
    content.vb: Public Interface IArchiveProvider Inherits IArchiveProviderHasRows, IArchiveProviderHasColumns, IArchiveProviderHasEntities
